      {/* <body class="bg-gray-100">
        <div class="container mx-auto p-4">
          <h1 class="text-2xl font-bold mb-4">Thời khóa biểu</h1>
          <div class="grid grid-cols-7 gap-4">
            <div class="flex flex-col gap-y-10">
              <div class="bg-white p-4">
